import React from 'react';

class Navbar extends React.Component {
  render () {
    
    return (
      <div>
        <div>
            <img src='https://cdn-icons-png.flaticon.com/128/891/891462.png' alt='cart-icon'/>
            <span></span>
        </div>
      </div>
    );
  }
}

const styles = {
  image: {
    height: 110,
    width: 110,
    borderRadius: 4,
    background: '#ccc'
  }
}

export default Navbar;
